import React, { useEffect, useState } from 'react'
import './Newsapp.css'

const Newsapp = () => {
    const [value, setValue]=useState('')
    useEffect(()=>{data()})
    const data=async()=>{
        const res = await fetch("https://newsapi.org/v2/everything?q=bitcoin&apiKey=a1af0b62d03445f8ae9eb43a20863707")
        const result = await result.json()
        setValue(result.articles)
    }
  return (
    <>
    {value.articles.map((items, index)=>{
        return(
            <div key={index}>
                <img src={items.urlToImage} alt="" />
            </div>
        )
    })}
      
    </>
  )
}

export default Newsapp
